pragma solidity ^0.4.11;

contract MonkeyCore {
    address public owneraddress;

    function MonkeyCore() public{
        owneraddress = msg.sender;
        Init();
    }

    modifier onlyOwner() {
        require(msg.sender == owneraddress);
        _;
    }

    function test () public returns(bool) {
        if (msg.sender == owneraddress){
            return true;
        }
        return false;
    }

    struct Monkey {
        uint256 key;
        uint256 fight;
        bool state;
        uint256 level;
    }

    struct Player {
        uint256 key;
        address owner;
        uint256 level;
        uint256 power;
        uint256 logintime;
        bool state;  /////////
    }

    struct Level {
        uint256 key;
        uint256 difficulty;
        bool special;
        uint256 specialcount;
        uint256 allcount;
        uint256 addrange;
        uint256 addmin;
        bool state;
    }

    mapping (uint256 => Monkey) monkeys;
    mapping (uint256 => Player) players;
    mapping (uint256 => Level) levels;
    mapping (uint256 => address) monkey2owner;
    mapping (address => uint256) owner2monkey;
    mapping (address => uint256) owner2player;

    uint256 freemonkey = 1;
    uint256 playercount = 1;
    uint256 levelcount = 1;
    uint256 initpower = 10;
    uint256 allmonkey = 5000;
    uint256 conversionfight = 100000000000000;   ////0.0001eth
    uint256 conversionpower = 1000000000000000;  ////0.001eth
    uint256 wei2eth = 1000000000000000000;
    uint256 oneday = 24 * 60 * 60;

    event BuyMonkeySuccess (address, uint256, bool);
    event BuyMonkeyFail (bool, bool, uint256, uint256, uint256, uint256);
    event AddLevelResult (uint256, uint256, uint256, uint256, uint256, uint256);
    event UpgrageFail (uint256, uint256);
    event CheckUpgradeFail (bool, bool, bool, uint256, uint256);
    event NewLevel (uint256, uint256, bool, uint256, uint256, uint256, uint256, bool);
    event NowLevel (uint256);

    function Init () private {
        monkeys[0] = Monkey({key:0,fight:0,state:true,level:0});
        players[0] = Player({key:0,owner:owneraddress,level:0,power:0,logintime:0,state:false});
        levels[0] = Level({key:0, difficulty:0, special:false, specialcount:0, allcount:0, addrange:0, addmin:0, state:false});
    }

    function CheckHaveMonkey () private view returns (bool) {
        Player player = players[owner2player[msg.sender]];
        return player.state;
    }

    function CheckHavePlayer () private view returns (bool) {
        if (owner2player[msg.sender] == 0){
            return false;
        } else {
            return true;
        }
    }

    function GetPlayerLength () public view returns (uint256) {
        return playercount;
    }

    function GetLevelLength () public view returns (uint256) {
        return levelcount;
    }

    function CreatePlayer () private {
        uint256 _key = GetPlayerLength();
        Player memory player = Player({key:_key, owner:msg.sender, level:0, power:5, logintime:now, state:false});
        players[_key] = player;
        owner2player[msg.sender] = _key;
        playercount ++;
    }

    function CreateMonkey (uint256 _key) private {
        uint256 random = uint(keccak256(now, msg.sender)) % 30;
        uint256 _fight = 100 + random;
        monkeys[_key] = Monkey({key:_key,fight:_fight,state:true,level:0});
        monkey2owner[_key] = msg.sender;
        owner2monkey[msg.sender] = _key;
        freemonkey ++;
    }

    function ChangePlayerState (bool _state) private {
        uint256 _key = owner2player[msg.sender];
        Player player = players[_key];
        player.state = _state;
        players[_key] = player;
    }

    function ChangeMonkeyState (bool _state) private {
        uint256 _key = owner2monkey[msg.sender];
        Monkey monkey = monkeys[_key];
        monkey.state = _state;
        monkeys[_key] = monkey;
    }

    function FreeMonkey () public {
        require(!CheckHaveMonkey());
        require(freemonkey <= allmonkey);
        CreatePlayer();
        CreateMonkey(freemonkey);
        ChangePlayerState(true);
    }

    function BuyMonkey (uint256 _key) public payable{
        ///////////////monkey has owner
        if (!CheckHavePlayer()) {
            CreatePlayer();
        }
        if (!CheckHaveMonkey()) { 
            owner2monkey[msg.sender] = 0;
            ChangePlayerState(true);
        }
        require (CheckBuyMonkey(_key));
        ChangeBuyMonkeyState(_key);
    }

    function GetOwnMinValue () public view returns (uint256) {
        uint256 _key = owner2monkey[msg.sender];
        Monkey _monkey = monkeys[_key];
        uint256 minvalue = _monkey.fight * conversionfight * 6 / 5 ;
        return minvalue;
    }

    function GetBuyMinValue (uint256 _key) public view returns (uint256) {
        Monkey _monkey = monkeys[_key];
        uint256 minvalue;
        if (!CheckHavePlayer() || !CheckHaveMonkey()) {
            minvalue = _monkey.fight * conversionfight * 6 / 5 - _changemonkey.fight * conversionfight;
        } else {
            uint256 _changekey = owner2monkey[msg.sender];
            Monkey _changemonkey = monkeys[_changekey];
            minvalue = _monkey.fight * conversionfight * 6 / 5 - _changemonkey.fight * conversionfight;
        }
        return minvalue;
    }

    function ChangeBuyMonkeyState (uint256 _key) private {
        Monkey _monkey = monkeys[_key];
        address _owner = monkey2owner[_key];
        uint256 _changekey = owner2monkey[msg.sender];
        Monkey _changemonkey = monkeys[_changekey];

        require (_owner != msg.sender);

        _monkey.fight = (_changemonkey.fight + msg.value / conversionfight);
        monkeys[_key] = _monkey;
        owner2monkey[msg.sender] = _key;
        monkey2owner[_key] = msg.sender;

        owner2monkey[_owner] = _changekey;
        monkey2owner[_changekey] = _owner;

        emit BuyMonkeySuccess(msg.sender , _key, _key == owner2monkey[msg.sender]);
    }

    function CheckBuyMonkey (uint _key) private view returns(bool) {
        Monkey _monkey = monkeys[_key];
        uint256 _changekey = owner2monkey[msg.sender];
        Monkey _changemonkey = monkeys[_changekey];
        address _owner = monkey2owner[_key];

        uint256 minvalue = GetBuyMinValue (_key);
        uint256 fee = msg.value / 10 ;
        if (_monkey.state && _changemonkey.state && _monkey.fight >= _changemonkey.fight) {
            require (msg.value >= minvalue);
            _owner.transfer(msg.value - fee);
            owneraddress.transfer(fee);
            return true;
        } else {
            return false;
            emit BuyMonkeyFail(_monkey.state , _changemonkey.state, _monkey.fight, _changemonkey.fight, msg.value, minvalue);
        }
    }

    function UpgradeLevel (uint256 _key) public {
        require (CheckUpgrade(_key));
        Level level = levels[_key];
        Player player = players[owner2player[msg.sender]];
        Monkey monkey = monkeys[owner2monkey[msg.sender]];
        if (monkey.fight >= level.difficulty) {
            AddLevel(_key);
        } else {
            player.power --;
            players[owner2player[msg.sender]] = player;
            emit UpgrageFail (monkey.fight, level.difficulty);
        }
    }

    function CheckUpgrade (uint256 _key) private view returns (bool) {
        Level level = levels[_key];
        Player player = players[owner2player[msg.sender]];
        Monkey monkey = monkeys[owner2monkey[msg.sender]];
        if(level.state && player.state && monkey.state && player.power > 0 && monkey.level + 1 >= _key){
            return true;
        } else {
            emit CheckUpgradeFail (level.state, player.state, monkey.state, player.power, monkey.level + 1);
            return false;
        }
    }

    function AddLevel (uint _key) private {
        Level level = levels[_key];
        Player player = players[owner2player[msg.sender]];
        Monkey monkey = monkeys[owner2monkey[msg.sender]];
        uint256 random;
        if (_key > player.level) {
            player.level = _key;
        }

        if (monkey.level >= _key) {
            random = uint(keccak256(now, msg.sender)) % level.addmin;
            monkey.fight = monkey.fight + random;
        } else {
            if (level.special && level.specialcount > level.allcount) {
                random = uint(keccak256(now, msg.sender)) % (2 * level.addrange) + (2 * level.addmin);
            } else {
                random = uint(keccak256(now, msg.sender)) % level.addrange + level.addmin;
            }
            monkey.fight = monkey.fight + random;
            monkey.level = _key;
            level.allcount ++;
        }
        player.power --;
        monkeys[owner2monkey[msg.sender]] = monkey;
        players[owner2player[msg.sender]] = player;
        levels[_key] = level;
        emit AddLevelResult (random, monkey.fight, monkey.level, player.level, level.allcount, player.power);
    }

    function ChangeLevelState (uint256 _key, bool _state) private onlyOwner {
        Level level = levels[_key];
        level.state = _state;
        levels[_key] = level;
    }

    function GetPlayerInfo (uint256 _key) public view returns (uint256, address, uint256, uint256, uint256, bool) {
        Player player = players[_key];
        return (player.key, player.owner, player.level, player.power, player.logintime, player.state);
    }

    function GetLevelInfo (uint256 _key) public view returns (uint256, uint256, bool, uint256, uint256, uint256, uint256, bool) {
        Level level = levels[_key];
        return (level.key, level.difficulty, level.special, level.specialcount, level.allcount, level.addrange, level.addmin, level.state);
    }

    function GetMonkeyInfo (uint256 _key) public view returns (uint256, uint256, bool, uint256, address, uint256) {
        Monkey monkey = monkeys[_key];
        return (monkey.key, monkey.fight, monkey.state, monkey.level, monkey2owner[_key], monkey.fight * conversionfight * 6 / 5);
    }

    function GetOwnerInfo () public view returns (uint256, uint256) {
        return (owner2player[msg.sender], owner2monkey[msg.sender]);
    }

    function GetFreeMonkeyCount () public view returns (uint256) {
        return (allmonkey - freemonkey + 1);
    }

    function FreePower () public {
        if (!CheckHavePlayer()) {
            CreatePlayer();
        }
        uint256 _key = owner2player[msg.sender];
        Player player = players[_key];
        require(now - player.logintime >= oneday);
        player.logintime = now;
        AddPower (5);
    }

    function AddPower (uint256 _power) private {
        uint256 _key = owner2player[msg.sender];
        Player player = players[_key];
        player.power = player.power + _power;
        players[_key] = player;
    }

    function CheckBuypower (uint256 _power) private {
        uint256 _value = _power * conversionpower;
        require(msg.value >= _value);
        owneraddress.transfer(msg.value);
    }

    function BuyPower (uint256 _power) public payable{
        if (!CheckHavePlayer()) {
            CreatePlayer();
        }
        require(_power > 0);
        require(_power <101);
        CheckBuypower(_power);
        AddPower (_power);
    }

    function Training (uint256 _fight) public payable{
        require (CheckHavePlayer());
        Player player = players[owner2player[msg.sender]];
        require (player.state);
        Monkey monkey = monkeys[owner2monkey[msg.sender]];
        require (monkey.state);
        require (msg.value > conversionfight * _fight);
        owneraddress.transfer(msg.value);
        monkey.fight = monkey.fight + _fight;
        monkeys[owner2monkey[msg.sender]] = monkey;
    }

    function GetTrainingValue (uint256 _fight) public view returns (uint256) {
        return (conversionfight * _fight);
    }


    function CreateOneLevel () private onlyOwner{
        uint256 _key = GetLevelLength();
        uint256 _difficulty = 100 + (_key - 1) * 20;
        bool _special = (_key % 5 == 1);
        uint256 _specialcount = 0;
        if (_special) {
            _specialcount = 10;
        }
        uint256 _allcount = 0;
        uint256 _addrange = 15; /////////bian
        uint256 _addmin = 10;    /////////bian
        bool _state = true;
        Level memory level = Level({key:_key,difficulty:_difficulty,special:_special,specialcount:_specialcount,allcount:_allcount,addrange:_addrange,addmin:_addmin,state:_state});
        levels[_key] = level;
        levelcount ++;
    }

    function ChangeLevel (uint256 _key, uint256 _difficulty, bool _special, uint256 _specialcount, uint256 _allcount, uint256 _addrange, uint256 _addmin, bool _state) public onlyOwner {
        Level level = levels[_key];
        level.difficulty = _difficulty;
        level.special = _special;
        level.specialcount = _specialcount;
        level.addrange = _addrange;
        level.addmin = _addmin;
        level.state = _state;
        levels[_key] = level;
        emit NewLevel (_key, _difficulty, _special, _specialcount, _allcount, _addrange, _addmin, _state);
    }

    function CreateLevel (uint256 _count) public onlyOwner{
        for (uint256 i = 0; i < _count; i++) {
            CreateOneLevel();
        }
        emit NowLevel (GetLevelLength());
    }

}
